import { Box, Container, Stack, TextField } from "@mui/material";
import { Images } from "../Constants/images";
import { Search } from "@mui/icons-material";
import { useState } from "react";
import DateRangePicker from "tw-daterange";

const Home = () => {
  const containerStyles = {
    backgroundColor: "blue", // Set the background color to blue
  };

  const Styles = {
    backgroundImage: `url(${Images.BG})`,
    backgroundSize: "cover",
    backgroundRepeat: "no-repeat",
    height: "100%",
    width: "100%",
  };
  const [range, setRange] = useState({
    startDate: new Date(),
    endDate: new Date(),
  });
  const [Searchval, setSearchval] = useState("");

  return (
    <section className="h-screen w-screen">
      <div style={Styles}>
        <Container maxWidth="lg">
          <div className="w-[100%] h-[100%] text-white">
            <Stack
              direction={"column"}
              style={{ width: "100%", height: "780px" }}
            >
              <div className="my-[100px]">
                <h1 className="font-hometext text-center text-7xl text-primarycolor">
                  Your journey begins here
                </h1>
              </div>
              <div className="px-[20px]">
                <div
                  style={{
                    width: "100%",
                    height: "450px",
                    backgroundColor: "white",
                  }}
                  className="p-[30px] rounded-lg  "
                >
                  <Stack direction={"column"}>
                    <div className="h-[60px] my-[10px] w-[100%] p-[10px] ">
                      <h1 className="text-2xl font-mono text-primarycolor underline">
                        All Houses
                      </h1>
                    </div>
                    <div className="h-[70px] p-[10px] bg-gray-200 rounded-lg">
                      <Stack direction={"row"}>
                        <div className="p-[10px]">
                          <Search style={{ color: "#0a0a27" }} />
                        </div>
                        <div className="w-[100%]">
                          <input
                            type="text"
                            placeholder="Search..."
                            className="bg-transparent p-[15px] w-[100%] outline-none text-xl text-primarycolor"
                          />
                        </div>
                      </Stack>
                    </div>
                    <div className="my-[20px] h-[220px] bg-gray-200">
                      <Stack direction={"row"}>
                        <div>
                          <DateRangePicker
                            initialRange={range}
                            onUpdate={(dateRange) => {
                              setRange(dateRange);
                              setRange(dateRange);
                            }}
                          />
                        </div>
                        <div></div>
                      </Stack>
                    </div>
                  </Stack>
                </div>
              </div>
            </Stack>
          </div>
        </Container>
      </div>
    </section>
  );
};

export default Home;
